import React, { Component } from 'react';
import Particles from 'react-particles-js';
import App from '../App';

const particleOptions = {
  particles: {
    number: {
      value: 100,
      density: {
        enable: true,
        value_area: 500
      }
    }
  }
}

class Root extends Component {

	render() {
      return (
        <>
        <Particles className='particles' options={particleOptions}/>
        <App />
        </>
      );

    }
}

export default App;
